description:
This NFT re-generates itself each time an edition is sold! The art is physically "plottable" with fountain pens and is designed to produce 20cm x 20cm plots.

A history of all items accumulated is available on this interactive NFT itself. The generated art is deterministic and unpredictable depending on the buyers.

@greweb is happy to deliver physical plots for anyone who wants on the item number you want under the condition you have bought it once. The more the NFT gets bought, the more editions there will be. Please PM me before to confirm with me this is still a possibility.
